import React from 'react';
import photo from '../../files/website_david.jpeg';

function AboutMe() {
    return (
        <div className='about-me'>
            I was born and raised in Houston, TX.
            I am currently a senior student at Texas A&M University, majoring in applied mathematics with an emphasis in computer science.
            I also have two minors in computer science and cybersecurity. 
            I am seeking a career in software development.

        </div>
    )
}

export default AboutMe
